PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `web2s` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`url`	varchar ( 255 ),
	`created_at`	datetime,
	`updated_at`	datetime,
	`manual`	boolean,
	`easy`	boolean,
	`bad`	boolean
);
CREATE TABLE `schema_migrations` (
	`version`	varchar ( 255 ) NOT NULL
);
CREATE TABLE `projects` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar ( 255 ),
	`url`	varchar ( 255 ),
	`created_at`	datetime,
	`updated_at`	datetime
);
CREATE TABLE `project_keywords` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`project_id`	integer,
	`keyword_id`	integer,
	`created_at`	datetime,
	`updated_at`	datetime
);
CREATE TABLE `keywords` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`keyword`	varchar ( 255 ),
	`link`	varchar ( 255 ),
	`created_at`	datetime,
	`updated_at`	datetime,
	`email`	varchar ( 255 ),
	`password`	varchar ( 255 ),
	`password2`	varchar ( 255 ),
	`description`	text,
	`logo_path`	varchar ( 255 ),
	`anchor_text`	varchar ( 255 ),
	`city`	varchar ( 255 ),
	`small_logo_path`	varchar ( 255 ),
	`zipcode`	varchar ( 255 ),
	`country`	varchar ( 255 )
, "address" varchar(255), "state" varchar(255));
CREATE TABLE `keyword_web2s` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`keyword_id`	integer,
	`web2_id`	integer,
	`created_at`	datetime,
	`updated_at`	datetime,
	`link`	varchar ( 255 )
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `unique_schema_migrations` ON `schema_migrations` (
	`version`
);
COMMIT;
